import "./RoundKnob.css";
import App from "../App";
import portfolioContent from "../Data/data";
function changeIL(i) {
  alert("cerf");
  if (i == 0) {
    i = portfolioContent.length;
  } else {
    i = i - 1;
  }
  App();
}

function RoundKnobL(props) {
  const i = props.i;
  const sc = props.sc;

  return (
    <button className="round" onClick={changeIL(i)}>
      {props.children}
    </button>
  );
}

export default RoundKnobL;
